import React from "react";
import { ReactComponent as Phone } from "../images/phone.svg";
import { ReactComponent as Mail } from "../images/mail.svg";
import { ReactComponent as Home } from "../images/home.svg";
import { ReactComponent as Linkedin } from "../images/linkedin.svg";

const Contact = ({ contact }) => {
  return (
      <div>
      <div>
          <Phone className="phone"/> 
      <Mail className="mail"/> 
      <Home className="home"/>
      <Linkedin className="linkedin"/> 
      </div>
    <li className="contact-container">
      <p className="contact-information">{contact.phone}</p>
      <p className="contact-information">{contact.email}</p>
      <p className="contact-information">{contact.website}</p>
      <p className="contact-information">{contact.linkedin}</p>
    </li>
    </div>
  );
};

export default Contact;
